import React from "react";
import { Navbar, NavbarBrand, NavItem } from "reactstrap";
import { NavLink, Routes, Route } from "react-router-dom";
import "../App.css";
import Home from "./Home";
import Product from "./Product";
import CreateCard from "./CreateCard";
import ProductDetails from "./productDetails";
import AddMember from "../component/AddMember";
import Teams from "./Teams";
import Qutation from "./Qutation";
import B2Bsheet from "./B2Bsheet";
import Salessheet from "./Salessheet";
import SalesSheetCard from "./SalesSheetCard";
import FilterEmail from "./FilterEmail";

function MyNavpar() {
  return (
    <div>
      <nav>
        <h1>
          <NavLink to="/">
            <i className="fas fa-code"></i> Shamel.Safa
          </NavLink>
        </h1>
        <ul>
          <li>
            <NavLink to="/Salessheet" activeClassName="active">
              SalesSheetForm
            </NavLink>
          </li>
          <li>
            <NavLink to="/item" activeClassName="active">
              Product
            </NavLink>
          </li>
          <li>
            <NavLink to="/CreateProduct" activeClassName="active">
              Create Product
            </NavLink>
          </li>
          <li>
            <NavLink to="/AddMember" activeClassName="active">
              AddMember
            </NavLink>
          </li>
          <li>
            <NavLink to="/Agent" activeClassName="active">
              Agent
            </NavLink>
          </li>
          <li>
            <NavLink to="/Qutation" activeClassName="active">
              B2B
            </NavLink>
          </li>
          <li>
            <NavLink to="/Mails" activeClassName="active">
              Emails
            </NavLink>
          </li>
        </ul>
      </nav>
      <section className="landing">
        <div className="dark-overlay">
          <div className="landing-inner">
            <h1 className="x-large">Connect Dots ... </h1>
            <p className="lead">
              Create & share posts and get help from others
            </p>
          </div>
        </div>
      </section>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/item" element={<Product />} />
        <Route path="/CreateProduct" element={<CreateCard />} />
        <Route path="/:ProductID" element={<ProductDetails />} />
        <Route path="/Agent" element={<Teams />} />
        <Route path="/AddMember" element={<AddMember />} />
        <Route path="/Qutation" element={<Qutation />} />
        <Route path="/B2BDATA" element={<B2Bsheet />} />
        <Route path="/Salessheet" element={<Salessheet />} />
        <Route path="/SalesSheetCard" element={<SalesSheetCard />} />
        <Route path="/Mails" element={<FilterEmail />} />
      </Routes>
    </div>
  );
}

export default MyNavpar;

